  false,\n\t\"url\": null,\n\t\"notes\": \"National Earthquake Hazard Reduction Program
  (NEHRP) seismic site classes for the metro Boise area. The intensity of ground shaking
  during an earthquake varies according to the nature of near-surface materials. NEHRP
  site classes quantify this effect and permit adjustment of expected ground motion.
  Site classes B, BC, C, and E are used. Classification of sites is largely based
  upon a geologic map (Othberg and Stanford, 1992, IGS GM-18, scale 1:100,000) and
  a compilation of standard penetration test N (blows/ft) data from geotechnical foundation
  reports in the project area. This work is a regional screening exercise based upon
  widely separated localities at a scale of 1:100,000. Site-specific geotechnical
  investigations are required to determine actual ground conditions for individual
  building sites.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
